import "../styles/scss/themes.scss";
import '../styles/globals.scss';
import { Provider } from "react-redux";
import Store from "../redux/store";

function MyApp({ Component, pageProps }) {
	return (
		<Provider Store={Store}>
			<Component {...pageProps} />
		</Provider>
	)
}

export default MyApp;
